class Tree extends StatefulWidget {
  const Tree({Key? key}) : super(key: key);

  @override
  _TreeState createState() => _TreeState();
}

class _TreeState extends State<Tree> {

  final Graph graph = Graph()..isTree = true;
  BuchheimWalkerConfiguration builder = BuchheimWalkerConfiguration();

/*  Map<String, dynamic> jsonData = {};
  loadJson() async {
    String jsonContent = await rootBundle.loadString('assets/data/B_8.json');
    return jsonDecode(jsonContent);
  }*/

  @override
  void initState() {

//    jsonData = loadJson();

    for (var element in jsonData['edges']!) {
      var fromNodeId = element['from'];
      var toNodeId = element['to'];
      graph.addEdge(Node.Id(fromNodeId), Node.Id(toNodeId));
    }

    builder
      ..siblingSeparation = (5)
      ..levelSeparation = (5)
      ..subtreeSeparation = (5)
      ..orientation = (BuchheimWalkerConfiguration.ORIENTATION_LEFT_RIGHT);

    setState(() {});
  }

  Widget rectangleWidget(a) {
    return InkWell(
      onTap: () {
          if (kDebugMode) {
            print('clicked');
          }
      },
      child: Container(
          padding: const EdgeInsets.all(1),
          decoration: BoxDecoration(
            borderRadius: BorderRadius.circular(1),
            boxShadow: const [
              BoxShadow(color: Colors.lightGreen, spreadRadius: 1),
            ],
          ),
          //child: Text('$a')
      ),
    );
  }

  Widget emptyWidget() {
    return const SizedBox();
  }

  @override
  Widget build(BuildContext context) {
    return InteractiveViewer(
        constrained: false,
        boundaryMargin: const EdgeInsets.all(200),
        minScale: 0.1,
        maxScale: 1,
        child: jsonData.keys.isEmpty?Container():GraphView(
          graph: graph,
          algorithm: BuchheimWalkerAlgorithm(builder, TreeEdgeRenderer(builder)),
          paint: Paint()
            ..color = Colors.black
            ..strokeWidth = 1
            ..style = PaintingStyle.stroke,
          builder: (Node node) {
            // I can decide what widget should be shown here based on the id
            var a = node.key!.value as int;
            var nodes = jsonData['nodes'];
            var nodeValue = nodes!.firstWhere((element) => element['id'] == a);
            if (nodeValue['name'] != 'Clade') {
              return rectangleWidget(nodeValue['name'] as String);
            } else {
              return emptyWidget();
            }
            },
        )
    );
  }
}